package com.pocopi.api.unit.form;import com.pocopi.api.models.form.UserFormSubmissionModel;import com.pocopi.api.models.form.FormModel;import com.pocopi.api.models.form.FormType;import com.pocopi.api.models.test.UserTestAttemptModel;import com.pocopi.api.models.test.TestGroupModel;import com.pocopi.api.models.config.ConfigModel;import com.pocopi.api.models.user.UserModel;import org.junit.jupiter.api.Test;import java.time.Instant;import static org.junit.jupiter.api.Assertions.*;class UserFormSubmissionModelTest {    @Test    void testBuilderAndFields() {        UserModel user = UserModel.builder()                .username("john_tester")                .password("123456789012345678901234567890123456789012345678901234567890")                .anonymous(false)                .build();        ConfigModel config = ConfigModel.builder()                .title("SubmissionConfig")                .description("Submission Desc")                .informedConsent("Consent")                .build();        TestGroupModel group = TestGroupModel.builder()                .config(config)                .label("FormGroup")                .probability((byte)99)                .build();        UserTestAttemptModel attempt = UserTestAttemptModel.builder()                .user(user)                .group(group)                .start(Instant.parse("2025-11-18T02:30:00Z"))                .build();        FormModel form = FormModel.builder()                .title("SurveyForm")                .type(FormType.POST)                .build();        Instant timestamp = Instant.parse("2025-11-18T02:45:00Z");        UserFormSubmissionModel submission = UserFormSubmissionModel.builder()                .attempt(attempt)                .form(form)                .timestamp(timestamp)                .build();        assertEquals(attempt, submission.getAttempt());        assertEquals(form, submission.getForm());        assertEquals(timestamp, submission.getTimestamp());        assertEquals(0L, submission.getId());    }    @Test    void testSettersAndGetters() {        UserFormSubmissionModel submission = new UserFormSubmissionModel();        UserTestAttemptModel attempt = UserTestAttemptModel.builder()                .user(UserModel.builder()                        .username("setter_user")                        .password("123456789012345678901234567890123456789012345678901234567890")                        .anonymous(false)                        .build())                .group(TestGroupModel.builder()                        .config(ConfigModel.builder()                                .title("SetConfig")                                .description("Set")                                .informedConsent("SetConsent")                                .build())                        .label("SetGroup")                        .probability((byte)57)                        .build())                .start(Instant.parse("2025-11-18T02:40:00Z"))                .build();        FormModel form = FormModel.builder()                .title("SetterForm")                .type(FormType.PRE)                .build();        Instant timestamp = Instant.parse("2025-11-18T02:50:00Z");        submission.setAttempt(attempt);        submission.setForm(form);        submission.setTimestamp(timestamp);        assertEquals(attempt, submission.getAttempt());        assertEquals(form, submission.getForm());        assertEquals(timestamp, submission.getTimestamp());    }}